import React from 'react';
import { Navbar, Container } from 'react-bootstrap';

function App() {
  return (
    <div>
      <Navbar fixed="top" bg="dark" variant="dark">
        <Container></Container>

      </Navbar>
      <h1>Hello From App</h1>
    </div>
  );
}

export default App;
